import React,{ Component } from 'react';
import { Table, Divider, Tag } from 'antd';

const { Column, ColumnGroup } = Table;

class OrderList extends Component{
	constructor(props){
        super(props);
        this.state = {
            data: []
        };
	}
	render(){
		return(
			<Table dataSource={data}>
				<Column title="订单号" dataIndex="firstName" key="firstName" />
				<Column title="收件人" dataIndex="lastName" key="lastName" />
				<Column title="订单状态" dataIndex="age" key="age" />
				<Column title="订单总价" dataIndex="address" key="address" />
				<Column title="订单时间" dataIndex="address" key="address" />
				<Column
					title="Tags"
					dataIndex="tags"
					key="tags"
					render={tags => (
						<span>
						{tags.map(tag => (
							<Tag color="blue" key={tag}>
							{tag}
							</Tag>
						))}
						</span>
					)}
				/>
				<Column
					title="Action"
					key="action"
					render={(text, record) => (
						<span>
						<a href="javascript:;">Invite {record.lastName}</a>
						<Divider type="vertical" />
						<a href="javascript:;">Delete</a>
						</span>
					)}
				/>
			</Table>
		)
	}
}

const data = [
  {
    key: '1',
    firstName: 'John',
    lastName: 'Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    firstName: 'Jim',
    lastName: 'Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    firstName: 'Joe',
    lastName: 'Black',
    age: 32,
    address: 'Sidney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];


export default OrderList;
